import Header from "../components/Header";
import Footer from "../components/Footer";
import "./css/Normalize.css"
import "./css/Home.css"
import { Button } from "@mui/material";
import { createTheme } from '@mui/material/styles';
import { ThemeProvider } from '@emotion/react';
import moment from '@date-io/moment';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import * as React from 'react';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterMoment } from '@mui/x-date-pickers/AdapterMoment';import { TimePicker } from '@mui/x-date-pickers/TimePicker';
import { DateTimePicker } from '@mui/x-date-pickers/DateTimePicker';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import { MobileDatePicker } from '@mui/x-date-pickers/MobileDatePicker';

import PickupSearch from "../components/LocationPSearch";
import DropoffSearch from "../components/LocationDSearch";

// Changes color to a reddish color
const theme = createTheme({
    palette: {
        primary: {    
            light: '#ff7961',
            main: '#f44336',
            dark: '#ba000d',
            contrastText: '#fff',
        }
    }
})

const Home = () => {
  return (
    <div>
      <body> 
        <Header/>
        <div class="jumbotron-image">
          <div class="jumbotron-card">
            <div class="pickup-search">
              <PickupSearch/>
            </div>
            <div class="dropoff-search">
              <DropoffSearch/>
            </div>
            <div class="pickup-date">
            test
            </div>
            <div class="dropoff-date">
             test
            </div>
            <div class="pickup-time">
             test
            </div>
            <div class="dropoff-time">
              test
            </div>
            <div class="search-button">
              <ThemeProvider theme={theme}>
               <Button variant="contained">Search</Button>
              </ThemeProvider>
            </div>
          </div>
        </div>
        <Footer/>
      </body>
    </div>
  );
};

export default Home;
